function PHI() {
  document.getElementById("logoimage").innerHTML =
    '<img class="teamlogo" itemscope="image" alt="Philadelphia Phillies Logo" src="http://content.sportslogos.net/logos/54/70/full/7579_philadelphia_phillies-primary-2019.png">';
  document.getElementById("tt0").innerText = "Philadelphia Phillies";
  document.getElementById("tt1").innerHTML =
    "<strong>Team Names: </strong>Philadelphia Phillies, Philadelphia Quakers ";
  document.getElementById("tt2").innerHTML =
    "<strong>Seasons: </strong>\137 (1883 to 2019)  ";
  document.getElementById("tt3").innerHTML =
    "<strong>Record: </strong>9825-11000, .472 W-L%  ";
  document.getElementById("tt4").innerHTML =
    "<strong>Playoff Appearances: </strong>\14";
  document.getElementById("tt5").innerHTML = "<strong>Pennants: </strong>\7";
  document.getElementById("tt6").innerHTML =
    "<strong>World Championships: </strong>\2";
  document.getElementById("tt7").innerHTML =
    "<strong>Winningest Manager: </strong>Charlie Manuel, 780-636, .551 W-L%";

  globalTeam = "PHI";
  clearBox("charts");
  var html = "";
  for (var yr in PHIData) {
    html =
      html +
      '<div id="' +
      PHIData[yr].name +
      '" class="year" data-title="' +
      PHIData[yr].title +
      '" data-subtitle="' +
      PHIData[yr].subtitle +
      '"></div>';
  }

  $("#charts").append(html);

  $.getScript("https://code.highcharts.com/highcharts.js", function() {
    var chart;
    $(document).ready(function() {
      //Setting the global default
      Highcharts.setOptions({
        chart: {
          type: "areaspline",
          marginRight: 2,
          marginBottom: 5,
          threshold: null
        },
        colors: ["#173368"],
        title: {
          style: {
            color: "#000000",
            /*fontWeight: 'bold',*/
            fontSize: "13px"
          },
          align: "left",
          floating: true,
          x: 35,
          y: 15
        },
        subtitle: {
          align: "left",
          floating: true
        },
        xAxis: {
          categories: []
        },
        yAxis: {
          plotLines: [
            {
              value: 0,
              width: 1,
              color: "#cccccc"
            }
          ],
          title: {
            text: "",
            margin: 0
          },
          plotLines: [
            {
              value: 0,
              width: 1,
              color: "#cccccc"
            }
          ],
          min: -20,
          max: 40
        },
        tooltip: {
          borderWidth: 0,
          formatter: function() {
            return "<b>" + this.point.name + "</b><br/>" + this.point.result;
          }
        },
        plotOptions: {
          series: {
            step: true,
            marker: {
              enabled: false
            }
          }
        },
        legend: {
          enabled: false
        },
        credits: {
          enabled: false
        }
      }); // end setting global default for all charts

      // Render all the charts!
      for (var yr in PHIData) {
        var options = {
          chart: {
            renderTo: PHIData[yr].name
          },
          title: {
            text: PHIData[yr].year
          },
          subtitle: {
            text: ""
          },
          series: [
            {
              name: PHIData[yr].name,
              data: PHIData[yr].data
            }
          ]
        };

        if (PHIData[yr].won < 1) {
          //losing year
          options.series[0].color = "#aa0016";
        }

        var chart = new Highcharts.Chart(options);
      }
    });
  });
}

